def PatternCount(Pattern, Text):
    count = 0
    for i in range(len(Text) - len(Pattern) + 1):
        if Text[i:i + len(Pattern)] == Pattern:
            count += 1
    return count

def FrequentWords(Text, k):
    frequentPatterns = []
    count = []
    for i in range(len(Text) - k):
        Pattern = Text[i:i+k]
        count.append(PatternCount(Pattern, Text))
    maxCount = max(count)
    for i in range(len(Text) - k):
        if count[i] == maxCount:
            frequentPatterns.append(Text[i:i+k])
    frequentPatterns = set(frequentPatterns)
    print(frequentPatterns)

def NumberToPattern(index, k):
    if k == 1:
        return NumberToSymbol(index)
    prefixIndex = index // 4
    r = index % 4
    symbol = NumberToSymbol(r)
    prefixPattern = NumberToPattern(prefixIndex, k - 1)
    return prefixPattern + symbol

def SymbolToNumber(symbol):
    if symbol == "A":
        return 0
    elif symbol == "C":
        return 1
    elif symbol == "G":
        return 2
    elif symbol == "T":
        return 3
    
def NumberToSymbol(number):
    if number == 0:
        return "A"
    elif number == 1:
        return "C"
    elif number == 2:
        return "G"
    elif number == 3:
        return "T"

def PatternToNumber(Pattern):
    if Pattern == "":
        return 0
    symbol = Pattern[-1]
    Prefix = Pattern[:-1]
    return 4 * PatternToNumber(Prefix) + SymbolToNumber(symbol)
    
def ComputingFrequencies(Text, k):
    FrequencyArray = []
    for i in range(int(math.pow(4, k))):
        FrequencyArray.append(0)
    for i in range(len(Text) - k + 1):
        Pattern = Text[i:i+k]
        j = PatternToNumber(Pattern)
        FrequencyArray[j] = FrequencyArray[j] + 1
    return FrequencyArray

def ComplementarySymbol(symbol):
    if symbol == "A":
        return "T"
    elif symbol == "C":
        return "G"
    elif symbol == "G":
        return "C"
    elif symbol == "T":
        return "A"

def ReverseComplement(Pattern):
    NewPattern = ""
    for i in range(len(Pattern)):
        NewPattern += ComplementarySymbol(Pattern[i])
    return NewPattern[::-1]

def PatternMatchArray(Pattern, Genome):
    locationArray = []
    for i in range(len(Genome) - len(Pattern)):
        if Genome[i:i+len(Pattern)] == Pattern:
            locationArray.append(i)
    return locationArray

def BetterClumpFinding(Genome, k, t, L):
    FrequentPatterns = []
    Clump = []
    for i in range(int(math.pow(4, k) - 1)):
        Clump.append(0)
    Text = Genome[0:L]
    FrequencyArray = ComputingFrequencies(Text, k)
    for i in range(int(math.pow(4, k) - 1)):
        if FrequencyArray[i] >= t:
            Clump[i] = 1
    for i in range(1, len(Genome) - L):
        FirstPattern = Genome[i - 1: i + k - 1]
        index = PatternToNumber(FirstPattern)
        FrequencyArray[index] = FrequencyArray[index] - 1
        LastPattern = Genome[i + L - k + 1: i + L + 1]
        index = PatternToNumber(LastPattern)
        FrequencyArray[index] = FrequencyArray[index] + 1
        if FrequencyArray[index] >= t:
            Clump[index] = 1
    for i in range(int(math.pow(4, k) - 1)):
        if Clump[i] == 1:
            Pattern = NumberToPattern(i, k)
            FrequentPatterns.append(Pattern)
    return FrequentPatterns
    
def Skew(Pattern):
    SkewArray = [0]
    for i in range(len(Pattern)):
        if Pattern[i] == "C":
            SkewArray.append(SkewArray[i] - 1)
        elif Pattern[i] == "G":
            SkewArray.append(SkewArray[i] + 1)
        else:
            SkewArray.append(SkewArray[i])
    return SkewArray

def MinimumSkew(Pattern):
    minimumSkewLocations = []
    SkewArray = Skew(Pattern)
    minimum = min(SkewArray)
    for i in range(len(SkewArray)):
        if SkewArray[i] == minimum:
            minimumSkewLocations.append(i)
    return minimumSkewLocations

def HammingDistance(FirstPattern, SecondPattern):
    difference = 0
    for i in range(len(FirstPattern)):
        if FirstPattern[i] != SecondPattern[i]:
            difference += 1
    return difference

def ApproximatePatternMatch(Pattern, Genome, d):
    locations = []
    for i in range(len(Genome) - len(Pattern) + 1):
        if HammingDistance(Pattern, Genome[i:i+len(Pattern)]) <= d:
            locations.append(i)
    return locations 
        
def ApproximatePatternCount(Pattern, Genome, d):
    locations = ApproximatePatternMatch(Pattern, Genome, d)
    return len(locations)

def Neighbors(Pattern, d):
    AllNucleotides = ["A", "C", "G", "T"] 
    if d == 0:
        return Pattern
    if len(Pattern) == 1:
        return AllNucleotides
    Neighborhood = []
    SuffixNeighbors = Neighbors(Pattern[1:], d)
    for Text in SuffixNeighbors:
        if HammingDistance(Pattern[1:], Text) < d:
            for x in AllNucleotides:
                Neighborhood.append(x + Text)
        else:
            Neighborhood.append(Pattern[0] + Text)
    if type(Neighborhood) != list:
            Neighborhood = [Neighborhood]
    return Neighborhood
        
def FrequentWordsWithMismatches(Text, k, d):
    FrequentPatterns = []
    FrequencyArray = []
    Close = []
    for i in range(int(math.pow(4, k) - 1)):
        Close.append(0)
        FrequencyArray.append(0)
    for i in range(len(Text) - k + 1):
        Neighborhood = Neighbors(Text[i: i+k], d)
        if type(Neighborhood) != list:
            Neighborhood = [Neighborhood]
        for Pattern in Neighborhood:
            index = PatternToNumber(Pattern)
            Close[index] = 1
    for i in range(int(math.pow(4, k) - 1)):
        if Close[i] == 1:
            Pattern = NumberToPattern(i, k)
            FrequencyArray[i] = ApproximatePatternCount(Pattern, Text, d)
    maxCount = max(FrequencyArray)
    for i in range(int(math.pow(4, k) -1)):
        if FrequencyArray[i] == maxCount:
            Pattern = NumberToPattern(i, k)
            FrequentPatterns.append(Pattern)
    return FrequentPatterns


def FrequentWordsWithMismatchesAlt(Text, k, d):
    FrequentPatterns = []
    Close = []
    for i in range(int(math.pow(4, k) - 1)):
        Close.append(0)
    for i in range(len(Text) - k + 1):
        Neighborhood = Neighbors(Text[i:i+k], d)
        if type(Neighborhood) != list:
            Neighborhood = [Neighborhood]
        for Pattern in Neighborhood:
            index = PatternToNumber(Pattern)
            Close[index] = Close[index] + 1
            index = PatternToNumber(ReverseComplement(Pattern))
            Close[index] = Close[index] + 1
    maxCount = max(Close)
    for i in range(int(math.pow(4, k) - 1)):
        if Close[i] == maxCount:
            pattern = NumberToPattern(i, k)
            FrequentPatterns.append(pattern)
    return FrequentPatterns

def MotifEnumeration(DNA, k, d):
    Patterns = []
    count = 0
    for Pattern in DNA:
        for i in range(len(Pattern) - k + 1):
            Neighborhood = Neighbors(Pattern[i:i+k], d)
            for Neighbor in Neighborhood:
                for Pattern in DNA:
                    if ApproximatePatternCount(Neighbor, Pattern, d) > 0:
                        count += 1
                    if count == len(DNA):
                        Patterns.append(Neighbor)
                count = 0
    Patterns = set(Patterns)
    return Patterns

def DistanceBetweenPatternAndStrings(Pattern, Dna):
    k = len(Pattern)
    distance = 0
    for Text in Dna:
        hammingdistance = sys.maxsize
        for i in range(len(Text) - k + 1):
            if hammingdistance > HammingDistance(Pattern, Text[i:i+k]):
                hammingdistance = HammingDistance(Pattern, Text[i:i+k])
        distance = distance + hammingdistance
    return distance

def MedianString(Dna, k):
    distance = sys.maxsize
    for i in range(int(math.pow(4, k) - 1)):
        Pattern = NumberToPattern(i, k)
        if distance > DistanceBetweenPatternAndStrings(Pattern, Dna):
            distance = DistanceBetweenPatternAndStrings(Pattern, Dna)
            Median = Pattern
    return Median

def MostProbable(Genome, k, Profile):
    ProbArray = []
    for i in range(len(Genome) - k + 1):
        Pattern = Genome[i:i+k]
        prob = 1
        for j in range(len(Pattern)):
            prob = prob * Profile[j][SymbolToNumber(Pattern[j])]
        ProbArray.append(prob)
    for prob in ProbArray:
        if prob == max(ProbArray):
            MostProbablePatternLocation = ProbArray.index(max(ProbArray))
            break
    return Genome[MostProbablePatternLocation:MostProbablePatternLocation + k]

def Profile(DnaList, k):
    profile = []
    t = len(DnaList)
    for i in range(k):
        acount = 1
        ccount = 1
        gcount = 1
        tcount = 1        
        for dna in DnaList:
            if dna[i] == "A":
                acount += 1
            elif dna[i] == "C":
                ccount += 1
            elif dna[i] == "G":
                gcount += 1
            elif dna[i] == "T":
                tcount += 1
        profile.append([acount / t, ccount / t, gcount / t, tcount / t])
    return profile
        
def GreedyMotifSearch(Dna, k, t):
    BestMotifs = []  
    for text in Dna:
        BestMotifs.append(text[:k])
    for i in range(len(Dna[0]) - k + 1):
        Motif = [Dna[0][i:i+k]]
        for i in range(t - 1):
            profile = Profile(Motif,k)
            Motif.append(MostProbable(Dna[i+1], k, profile))
        if Score(Motif) < Score(BestMotifs):
            BestMotifs = Motif
    return BestMotifs

def Consensus(Motifs, k):
#     print(Motifs)
    profile = Profile(Motifs, k)
#     print(profile)
    consensusMotif = ""
    for Letter in profile:
        consensusMotif += NumberToSymbol(Letter.index(max(Letter)))
#     print(consensusMotif)
    return consensusMotif
    
