def Score(DnaList, k):
    count = 0
    consensus = Consensus(DnaList, k)
    for dna in DnaList:
        count += HammingDistance(dna, consensus)
    return count

def RandomizedMotifSearch(Dna, k, t):
    Motifs = []
    for dna in Dna:
        startPoint = random.randint(0,len(dna) - k)
        randomKmer = dna[startPoint: startPoint + k]
        Motifs.append(randomKmer)
    BestMotifs = Motifs
    while (True):
        profile = Profile(Motifs, k)
        Motifs = []
        for dna in Dna:
            Motifs.append(MostProbable(dna, k, profile))
        if Score(Motifs, k) < Score(BestMotifs, k):
            BestMotifs = Motifs
        else:
            return BestMotifs
        
def ThousandTimesRandomizedMotifSearch(Dna, k, t):
    BestMotif = RandomizedMotifSearch(Dna, k, t)
    BestCurrentScore = sys.maxsize
    for i in range(10):
        Motif = RandomizedMotifSearch(Dna, k, t)
        MotifScore = Score(Motif, k)
        if MotifScore < BestCurrentScore:
            print(BestCurrentScore)
            BestCurrentScore = MotifScore
            BestMotif = Motif
    return BestMotif

